import React from "react";


export const GoogleButton = ({type, title, onSubmit, className}) =>{
  return(
    <>
      <button type={type} className={`${className} title2 text-align-center primary-button`} onSubmit={onSubmit? onSubmit : null}><img alt={'google-favicon'} src={require('../../assets/Google-favicon-2015.png')} className={'mr-4'}/>{title}</button>
    </>
  )
};
